import logo from './aiu.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <button class="button-56" >Check out!</button>

      </header>
    </div>
  );
}

export default App;
